///ðŸ“¨send sms to a mobile number
String otpServiceEndpoint({@required String mobile, @required String message}) {
  if (mobile == '' || mobile == null) {}
  String url = 'https://indiahealthlink.com/sendsms/send.php';
  String query = '?number=$mobile&message=$message';
  return url + query;
}

